import React from 'react';

function Eventreg() {
    return (
        <div>
            <h3>Create New Event</h3>
            <Form>
  <Form.Group controlId="formBasicEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" placeholder="" />
  </Form.Group>
  </Form>

            
        </div>
    )
}

export default Eventreg
